img.leaflet-tile {

margin: 0;

.legend svg text {
fill: #555;
}
.legend svg line {
stroke: #555;
}
.legend i {
width: 18px;
height: 18px;
margin-right: 4px;

display: inline-block;
vertical-align: top;

*display: inline;
}

.marker-cluster span {
